import useUser from "../hooks/useUser";

const dashboard = () => {
  const { user, isAuthenticated, authenticating } = useUser();
  return (
    <>
      {isAuthenticated && !authenticating && (
        <div>
          <h1>Welcome {user?.name}</h1>
        </div>
      )}
    </>
  );
};

export default dashboard;
